import './SideVideoList.scss';
import SideVideo from '../SideVideo/SideVideo';

export default function SideVideoList ({videoList}) {
    const videos = videoList.splice(0, 1);
    return (
        <section className="sidevideolist">
            <h2 className="sidevideolist-title">NEXT VIDEO</h2>
            {videos.map((sideVideo, index) => <
                SideVideo key={index} 
                          id={sideVideo.id} 
                          title={sideVideo.title} 
                          channel={sideVideo.channel} 
                          image={sideVideo.image}>
                </SideVideo>)}
        </section>
    );
};
